import React from "react";

export default function Footer() {
  return (
    <footer className="footer">
      <div>
        <p>
          <a
            href="https://github.com/cbazil114"
            target="_blank"
            ref="noreferror"
          >
            Github
          </a>
          <a
            href="https://www.linkedin.com/in/connor-bazil-415b9440/"
            target="_blank"
            rel="noreferror"
          >
            LinkedIn
          </a>
          <a
            href="https://twitter.com/conbazil"
            target="_blank"
            rel="noreferror"
          >
            Twitter
          </a>
        </p>
      </div>
    </footer>
  );
}

